import './App.css';

function App() {
  return (
    <div className="App">
      <div className='container'>
        <div className='TopNavbar'></div>
        <div className='IntroPage'></div>
        <div className='InfoPage'></div>
        <div className='Footer'></div>
      </div>
    </div>
  );
}

export default App;
